import DialogItem from "../Message/DialogItem/DialogsItem";


function Users(props) {
    let state = props.usersPage
    let usersElements = state.users.map(ue => <div> key={ue.id}
        // for avatar and button "follow"
        <span>
            <div>
                <img/>
            </div>
            <div>
                <button>
                    Follow
                </button>
            </div>
        </span>
        // for name, location and status
        <span>
            <span></span>
            <span></span>
        </span>
        name={ue.name} location = {ue.location} descriptionProfile={ue.descriptionProfile} </div>)
    return (<div>
            {usersElements}
        </div>)
}

export default Users;
